export const LOGIN = 'LOGIN'
export const LOGOUT = 'LOGOUT'

export const login = () => {
    return async (dispatch) => {
        return new Promise((resolve, reject) => {
            dispatch()
        })
    }
    // return {
    //     type: LOGIN,
    //     payload: true,
    // }
}

export function logout() {
    return new Promise((resolve, reject) => {
        resolve(false)
    })
    // return {
    //     type: LOGOUT,
    //     payload: false,
    // }
}
